    this.CreateRawDataSets = function ( startTime ) {

        var usable = new KeyPairCollection();

        var dataSets = this.testData.RawDataSets.DataSet;
        var count = dataSets.length;

        for ( var index = 0; index < count; index++ ) {
            var dataSet = dataSets[ index ];
            var values = dataSet.Values.Value;
            var dataValues = new UaDataValues( values.length );
            for ( var valueIndex = 0; valueIndex < values.length; valueIndex++ ) {
                var value = values[ valueIndex ];
                dataValues[ valueIndex ] = this.GetDataValue( startTime, value );
            }

            usable.Set( dataSet.Name, { DataValues: dataValues } );
        }

        return usable;
    };

    this.CreateProcessedDataSets = function ( startTime ) {

        var usable = [];

        var dataSets = this.testData.ProcessedDataSets.DataSet;
        var count = dataSets.length;

        for ( var index = 0; index < count; index++ ) {
            var dataSet = dataSets[ index ];

            print( "Processing " + dataSet.DataSetName + " index " + index + " aggregate " + dataSet.AggregateName );
            dataSet.Aggregate = this.GetAggregate( dataSet );

            var values = dataSet.Values.Value;

            var dataValues = new UaDataValues( values.length );
            for ( var valueIndex = 0; valueIndex < values.length; valueIndex++ ) {
                var value = values[ valueIndex ];

                dataValues[ valueIndex ] = this.GetDataValue( startTime, value, dataSet.Aggregate );
            }

            dataSet.UsableValues = dataValues;

            usable.push( dataSet );
        }

        return usable;
    };

    this.GetDataValue = function ( startTime, value, aggregate ) {

        // Javascript UaDataValue.New just doesn't work that well
        var dataValue = new UaDataValue();
        dataValue.StatusCode = this.GetStatus( value, aggregate );
        dataValue.Value = this.GetVariant( value );
        dataValue.ServerTimestamp = this.GetTimestamp( startTime, value );
        dataValue.SourceTimestamp = this.GetTimestamp( startTime, value );

        return dataValue;
    };

    this.GetVariant = function ( valueObject ) {

        var variant = new UaVariant();

        if ( isDefined( valueObject.Value ) ) {
            var value = valueObject.Value;
            if ( value.length > 0 ) {
                if ( value == "true" ) {
                    variant.setBoolean( true );
                } else if ( value == "false" ) {
                    variant.setBoolean( false );
                } else if ( value == 'Good' ) {
                    variant.setStatusCode( new UaStatusCode( StatusCode.Good ) );
                } else if ( value == 'Bad' ) {
                    variant.setStatusCode( new UaStatusCode( StatusCode.Bad ) );
                } else if ( value == 'Uncertain' ) {
                    variant.setStatusCode( new UaStatusCode( StatusCode.Uncertain ) );
                } else if ( value == 'BadNoData' ) {
                    variant.setStatusCode( new UaStatusCode( StatusCode.BadNoData ) );
                } else if ( value == 'UncertainDataSubNormal' ) {
                    variant.setStatusCode( new UaStatusCode( StatusCode.UncertainDataSubNormal ) );
                } else {
                    variant.setDouble( parseFloat( value ) );
                }
            }
        }

        return variant;
    };

    this.Aggregate_InfoType_DataValue = 0x400;
    this.Aggregate_BitMask = 0x0000FFFF;


    this.GetStatus = function ( valueObject, aggregate ) {
        var statusCode = new UaStatusCode( StatusCode.Good );

        if ( isDefined( valueObject.Quality ) ) {

            var qualities = valueObject.Quality.split( "," );
            var quality = qualities[ 0 ]

            if ( quality == "Bad" ) {
                statusCode = new UaStatusCode( StatusCode.Bad );
            } else if ( quality == "Uncertain" ) {
                statusCode = new UaStatusCode( StatusCode.Uncertain );
            } else if ( quality == "BadNoData" ) {
                statusCode = new UaStatusCode( StatusCode.BadNoData );
            } else if ( quality == "UncertainDataSubNormal" ) {
                statusCode = new UaStatusCode( StatusCode.UncertainDataSubNormal );
            }

            var aggregateBits = 0;

            for ( var index = 1; index < qualities.length; index++ ) {
                var subQuality = qualities[ index ].trim();
                if ( subQuality == "Calculated" ) {
                    aggregateBits |= AggregateBit.Calculated;
                } else if ( subQuality == "Interpolated" ) {
                    aggregateBits |= AggregateBit.Interpolated;
                } else if ( subQuality == "Partial" ) {
                    aggregateBits |= AggregateBit.Partial;
                } else if ( subQuality == "ExtraData" ) {
                    // Not in test data
                    aggregateBits |= AggregateBit.ExtraData;
                } else if ( subQuality == "MultipleValues" ) {
                    aggregateBits |= AggregateBit.MultipleValues;
                }
            }

            if ( aggregateBits > 0 ) {
                var maskedAggregates = ( aggregateBits | this.Aggregate_InfoType_DataValue ) & this.Aggregate_BitMask;
                statusCode = new UaStatusCode( statusCode.StatusCode + maskedAggregates );
            }
        }

        return statusCode;
    };

    this.GetTimestamp = function ( startTime, valueObject ) {
        var newTime = new UaDateTime( startTime );
        if ( isDefined( valueObject.Timestamp ) ) {
            var timestampString = valueObject.Timestamp;

            var findMilliseconds = timestampString.split( "." );
            var noMilliseconds;
            var milliseconds = 0;
            if ( isDefined( findMilliseconds.length ) ) {
                noMilliseconds = findMilliseconds[ 0 ];
                if ( isDefined( findMilliseconds[ 1 ] ) ) {
                    milliseconds = parseInt( findMilliseconds[ 1 ] );
                }
            } else {
                noMilliseconds = timestampString;
            }
            newTime.addMilliSeconds( milliseconds );

            var parts = noMilliseconds.split( ":" );
            if ( isDefined( parts.length ) ) {
                if ( isDefined( parts[ 0 ] ) ) {
                    var hour = parseInt( parts[ 0 ], '10' );
                    newTime.addHours( hour );
                }
                if ( isDefined( parts[ 1 ] ) ) {
                    var minutes = parseInt( parts[ 1 ], '10' );
                    newTime.addMinutes( minutes );
                }
                if ( isDefined( parts[ 2 ] ) ) {
                    var seconds = parseInt( parts[ 2 ], '10' );
                    newTime.addSeconds( seconds );
                }
            }
        }

        return newTime;
    };

