    this.ValidateTestCase = function ( testCase ) {
        var treatUncertainAsBad = 'false';
        var stepped = 'false';
        var sloped = 'false';
        var percentBad = '100';
        var percentGood = '100';

        if ( testCase.DataSetName == "Historian1" ) {
            treatUncertainAsBad = 'false';
            stepped = 'false';
            sloped = 'false';
            percentBad = '100';
            percentGood = '100';
        } else if ( testCase.DataSetName == "Historian2" ) {
            treatUncertainAsBad = 'true';
            stepped = 'false';
            sloped = 'true';
            percentBad = '100';
            percentGood = '100';
        } else if ( testCase.DataSetName == "Historian3" ) {
            treatUncertainAsBad = 'true';
            stepped = 'true';
            sloped = 'false';
            percentBad = '50';
            percentGood = '50';
        } else if ( testCase.DataSetName == "Historian4" ) {
            treatUncertainAsBad = 'true';
            stepped = 'true';
            sloped = 'false';
            percentBad = '100';
            percentGood = '100';
        } else if ( testCase.DataSetName == "Historian5" ) {
            treatUncertainAsBad = 'false';
            stepped = 'false';
            sloped = 'false';
            percentBad = '100';
            percentGood = '100';
        }

        var identify = testCase.DataSetName + ":" + testCase.AggregateName;
        var errors = [];
        if ( testCase.TreatUncertainAsBad != treatUncertainAsBad ) {
            errors.push( "    Stepped Expected " + treatUncertainAsBad + " Actual " + testCase.TreatUncertainAsBad );
        }
        if ( testCase.Stepped != stepped ) {
            errors.push( "    Stepped Expected " + stepped + " Actual " + testCase.Stepped );
        }
        if ( testCase.UseSlopedExtrapolation != sloped ) {
            errors.push( "    UseSlopedExtrapolation Expected " + sloped + " Actual " + testCase.UseSlopedExtrapolation );
        }
        if ( testCase.PercentBad != percentBad ) {
            errors.push( "    PercentBad Expected " + percentBad + " Actual " + testCase.PercentBad );
        }
        if ( testCase.PercentGood != percentGood ) {
            errors.push( "    PercentGood Expected " + percentGood + " Actual " + testCase.PercentGood );
        }

        if ( errors.length > 0 ) {
            print( identify );
            for ( var index = 0; index < errors.length; index++ ) {
                print( errors[ index ] );
            }
        }
    }

